import React from 'react';
 // Import your Google Play icon component
 import { FaGooglePlay } from 'react-icons/fa';

const Header = () => {
  return (
    <header>
      {/* Your header content here */}

      <nav>
        <ul>
       <li><FaGooglePlay /> Google Play</li>
          <li>Games</li>
          <li>Apps</li>
          <li>Movies</li>
          <li>Books</li>
          {/* Add more navigation items as needed */}
        </ul>
      </nav>
    </header>
  );
}

export default Header;
